import React from 'react';
import ReactDOM from 'react-dom';
import Card from './component/Card';
import Sdata from './Sdata';

ReactDOM.render(
  <>
    <h1 className='heading_style'>Top 5 Original Netflix seriese in 2021</h1>
    <Card 
    imgsrc = {Sdata[0].imgsrc} 
    title = {Sdata[0].title}
    sname = {Sdata[0].sname}
    link = {Sdata[0].link}  />

    <Card 
    imgsrc = {Sdata[0].imgsrc} 
    title = {Sdata[0].title}
    sname = {Sdata[0].sname}
    link = {Sdata[0].link}  />


  </>,
  document.getElementById("root")
);
